import React from 'react';
import '../App.css';

const HeaderButtons = ({ icon, description = "", url, imgClassName = "round-btn-header-img" }) => {
  const handleClick = () => {
    // Redirect to the provided URL
    window.open(url, '_blank');
  };

  return (
    <div className="round-btn-header-div">
      <button onClick={handleClick} className="round-btn-header-btn">
        <img src={icon} alt="Button Image" className={imgClassName} />
      </button>
      <span>{description}</span>
    </div>
  );
};

export default HeaderButtons;
